import "./Shop.scss";
import {Container, Row, Col} from 'react-bootstrap';
import Product from "../../components/ProductItem/Product";
import './shop.scss'
const Shop = () => {
  return (
    <>
     <Container>
      <Row>
        <Col className='my-5 shop-page' md='3'>
          <p>Sidebar</p>
        </Col>
        <Col className='shop-page-wrapper' md='9'>
          <Product/>
          <Product/>
          <Product/>
          <Product/>
          <Product/>
        </Col>
      </Row>
     </Container>
    </>
  );
};

export default Shop;
